import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Layout } from 'antd';
import Dashboard from './components/Dashboard';
import MemberJourney from './pages/MemberJourney';

const { Header, Content } = Layout;

function App() {
  return (
    <Router>
      <Layout style={{ minHeight: '100vh' }}>
        <Header style={{ background: '#1890ff', color: 'white', display: 'flex', alignItems: 'center' }}>
          <h1 style={{ color: 'white', margin: 0 }}>Elyx Member Dashboard</h1>
        </Header>
        <Content style={{ padding: '24px' }}>
          <Routes>
            <Route path="/" element={<Dashboard />} />
            <Route path="/member/:memberId" element={<MemberJourney />} />
          </Routes>
        </Content>
      </Layout>
    </Router>
  );
}

export default App;
